import './App.css';
import {useState, useEffect} from 'react';
import { Alert } from 'react';

function DrawBtn() {
	return (
		<div className="drawBtn">
			<div className="centeredContainer">
				<button className="padded" onPress={()=> Alert.alert('test')}>Submit!</button>
			</div>
		</div>
	);
}

export default DrawBtn;
